public int ladderLength\(String beginWord\, String endWord\, List\<String\> wordList\) \{
 Set\<String\> dic \= new HashSet\<\>\(wordList\)\;
 Set\<String\> vis \= new HashSet\<\>\(\)\;
 Queue\<String\> q \= new LinkedList\<\>\(\)\;
 q\.offer\(beginWord\)\;
 for\(int times\=1\;\!q\.isEmpty\(\)\;times\+\+\)\{
 for\(int i \=q\.size\(\)\;i\>0\;i\-\-\)\{
 String s \= q\.poll\(\)\;
 if\(s\.equals\(endWord\)\) return times\;
 for\(int cur \= 0\;cur\<s\.length\(\)\;cur\+\+\)\{
 char\[\] curArray \= s\.toCharArray\(\)\;
 for\(char c\='a'\;c\<\='z'\;c\+\+\)\{
 if\(curArray\[cur\]\=\=c\) continue\;
 curArray\[cur\]\=c\;
 String sb \= String\.valueOf\(curArray\)\;
 if\(dic\.contains\(sb\)\&\&vis\.add\(sb\)\) q\.offer\(sb\)\;
 \}
 \}
 \}
 \}
 return 0\;
 \}

public boolean isMonotonic\(int\[\] A\) \{
 if\(A\.length\=\=1\) return true\;
 boolean increasing \= false\;
 boolean decreasing \= false\;
 for\(int i\=1\;i\<A\.length\;i\+\+\)\{
 if\(A\[i\]\>A\[i\-1\] \&\& decreasing\)\{
 return false\;
 \}else if\(A\[i\]\<A\[i\-1\] \&\& increasing\)\{
 return false\;
 \}
 \}
 return true\;
 \}
